library;

class WeatherForecast {
  WeatherForecast({Location? location, Current? current, Forecast? forecast}) {
    _location = location;
    _current = current;
    _forecast = forecast;
  }

  WeatherForecast.fromJson(dynamic json) {
    _location = json['location'] != null
        ? Location.fromJson(json['location'])
        : null;
    _current = json['current'] != null
        ? Current.fromJson(json['current'])
        : null;
    _forecast = json['forecast'] != null
        ? Forecast.fromJson(json['forecast'])
        : null;
  }

  Location? _location;
  Current? _current;
  Forecast? _forecast;

  WeatherForecast copyWith({
    Location? location,
    Current? current,
    Forecast? forecast,
  }) => WeatherForecast(
    location: location ?? _location,
    current: current ?? _current,
    forecast: forecast ?? _forecast,
  );

  Location? get location => _location;

  Current? get current => _current;

  Forecast? get forecast => _forecast;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_location != null) {
      map['location'] = _location?.toJson();
    }
    if (_current != null) {
      map['current'] = _current?.toJson();
    }
    if (_forecast != null) {
      map['forecast'] = _forecast?.toJson();
    }
    return map;
  }
}

